import React from "react";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import { createBrowserHistory } from "history";

const Home: React.FC = () => <h2>Home Page</h2>;
const About: React.FC = () => <h2>About Page</h2>;
const Contact: React.FC = () => <h2>Contact Page</h2>;

const MainNavigation: React.FC = () => {
  const history = createBrowserHistory();

  const handleButtonClick = (path: string) => {
    history.push(path);
  };

  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <NavLink to="/">Our Mission</NavLink>
            </li>
            <li>
              <NavLink to="/sessions">Browse Sessions</NavLink>
            </li>
            <li>
              <button>Upcoming Session</button>
            </li>
          </ul>
        </nav>

        <button onClick={() => handleButtonClick("/about")}>Go to About</button>

        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </div>
    </Router>
  );
};

export default MainNavigation;
